import React from 'react';

class WireframeCard extends React.Component {

    render() {
        const { wireframe } = this.props;
        console.log("wireframeCard, wireframe.id: " + wireframe.id);
        return (
            <div className="card z-depth-2 rounded grey lighten-4 todo-list-link hoverable">
                <div className="card-content grey-text text-darken-4 item_card">
                    <div class="row">
                    <span className="card-title s6">{wireframe.name}</span>
                    <div className="delete=project btn-floating btn-large waves-effect waves-light purple lighten-3 s6" onClick={this.handleChange}><i class="material-icons">delete</i></div>
                    </div>
                </div>
            </div>
        );
    }
}
export default WireframeCard;
